<?php

defined('BASEPATH') OR exit('No direct script access allowed');

class SnifsSendPhoto extends CI_Controller {

    public static $path = "snifsSendPhoto/";

    function __construct() {
        parent::__construct();
        $this->load->model('Spage_model', 'page');
        $this->load->model('SnifsSendPhoto_model', 'nifsSendPhoto');
        $this->load->model('Suser_model', 'user');
        $this->load->model('Scategory_model', 'category');
        $this->load->model('ShrPeopleDepartment_model', 'hrPeopleDepartment');
        $this->load->model('Smodule_model', 'module');
        $this->load->model('Spartner_model', 'partner');
    }

    public function index() {

        $this->urlString = '';
        if ($this->session->isLogin === TRUE) {

            $this->header['cssFile'] = array();
            $this->footer['jsFile'] = array('/assets/system/core/nifsSendPhoto.js');

            $this->body['auth'] = authentication(array(
                'permission' => $this->session->authentication,
                'role' => 'isModule',
                'moduleMenuId' => $this->uri->segment(3),
                'createdUserId' => $this->session->userdata['adminUserId'],
                'currentUserId' => $this->session->userdata['adminUserId']));
            
            $this->body['module'] = $this->module->getData_model(array('id' => $this->body['auth']->modId));

            $this->header['pageMeta'] = $this->page->meta_model(array('pageTitle' => $this->body['module']->title));

            $this->load->view(MY_ADMIN . '/header', $this->header);
            if ($this->body['auth']->permission) {
                $this->load->view(MY_ADMIN . '/nifsSendPhoto/index', $this->body);
            } else {
                $this->load->view(MY_ADMIN . '/page/deny', $this->body);
            }
            $this->load->view(MY_ADMIN . '/footer', $this->footer);
        } else {

            redirect(MY_ADMIN);
        }
    }

    public function lists() {

        $this->urlString = '';
        if ($this->session->isLogin === TRUE) {

            $this->auth = authentication(array(
                'permission' => $this->session->authentication,
                'role' => 'read',
                'moduleMenuId' => $this->input->get('moduleMenuId'),
                'createdUserId' => 0,
                'currentUserId' => $this->session->userdata['adminUserId']));

            //total rows count
            $totalRec = $this->nifsSendPhoto->listsCount_model(array(
                'auth' => $this->auth,
                'modId' => $this->auth->modId,
                'catId' => $this->input->get('catId'),
                'authorId' => $this->input->get('authorId'),
                'inDate' => $this->input->get('inDate'),
                'outDate' => $this->input->get('outDate'),
                'keyword' => $this->input->get('keyword'),
                'departmentId' => $this->input->get('departmentId')));

            //get posts data
            $result = $this->nifsSendPhoto->lists_model(array(
                'auth' => $this->auth,
                'modId' => $this->auth->modId,
                'catId' => $this->input->get('catId'),
                'authorId' => $this->input->get('authorId'),
                'inDate' => $this->input->get('inDate'),
                'outDate' => $this->input->get('outDate'),
                'keyword' => $this->input->get('keyword'),
                'departmentId' => $this->input->get('departmentId'),
                'rows' => $this->input->get('rows'),
                'page' => $this->input->get('page')));
            
            echo json_encode(array('total' => $totalRec, 'rows' => $result['data'], 'search' => $result['search']));
            
        }
    }

    public function add() {

        if ($this->session->isLogin === TRUE) {


            $this->body['row'] = $this->nifsSendPhoto->addFormData_model();
            $this->module = $this->module->getData_model(array('id' => $this->body['row']->mod_id));
            $this->body['row']->module_title = $this->module->title . ' - нэмэх';

            $this->body['controlCategoryListDropdown'] = $this->category->controlCategoryListDropdown_model(array('modId' => $this->body['row']->mod_id, 'selectedId' => $this->body['row']->cat_id));

            echo json_encode(array(
                'title' => $this->body['row']->module_title,
                'btn_yes' => 'Хадгалах',
                'btn_no' => 'Хаах',
                'width' => 600,
                'html' => $this->load->view(MY_ADMIN . '/nifsSendPhoto/form', $this->body, TRUE)
            ));
        } else {
            redirect(MY_ADMIN);
        }
    }

    public function edit() {

        if ($this->session->isLogin === TRUE) {

            $this->body['row'] = $this->nifsSendPhoto->editFormData_model(array('selectedId' => $this->input->post('id')));
            $this->module = $this->module->getData_model(array('id' => $this->body['row']->mod_id));
            $this->body['row']->module_title = $this->module->title . ' - засах';

            $this->body['controlCategoryListDropdown'] = $this->category->controlCategoryListDropdown_model(array('modId' => $this->body['row']->mod_id, 'selectedId' => $this->body['row']->cat_id, 'required' => true));

            echo json_encode(array(
                'title' => $this->body['row']->module_title,
                'btn_yes' => 'Хадгалах',
                'btn_no' => 'Хаах',
                'width' => 600,
                'html' => $this->load->view(MY_ADMIN . '/nifsSendPhoto/formEdit', $this->body, TRUE)
            ));
        } else {
            redirect(MY_ADMIN);
        }
    }

    public function read() {

        if ($this->session->isLogin === TRUE) {

            $this->body['row'] = $this->nifsSendPhoto->editFormData_model(array('selectedId' => $this->input->post('id')));
            $this->module = $this->module->getData_model(array('id' => $this->body['row']->mod_id));
            $this->body['row']->module_title = $this->module->title . ' - засах';

            $imageInfo = getimagesize($_SERVER['DOCUMENT_ROOT'] . UPLOADS_NIFS_SEND_PHOTO_PATH . ltrim($this->body['row']->pic, 's_'));

            echo json_encode(array(
                'title' => $this->body['row']->description,
                'btn_close' => 'Хаах',
                'width' => (intval($imageInfo['0']) < 1500 ? $imageInfo['0'] : 1500),
                'html' => $this->load->view(MY_ADMIN . '/nifsSendPhoto/read', $this->body, TRUE)
            ));
        } else {
            redirect(MY_ADMIN);
        }
    }

    public function insert() {

        echo json_encode($this->nifsSendPhoto->insert_model(array('getUID' => getUID('nifs_send_photo'))));
    }

    public function update() {
        echo json_encode($this->nifsSendPhoto->update_model());
    }

    public function delete() {
        echo json_encode($this->nifsSendPhoto->delete_model());
    }

    public function searchForm() {
        if ($this->session->isLogin === TRUE) {

            $this->body['row'] = $this->nifsSendPhoto->addFormData_model();
            $this->module = $this->module->getData_model(array('id' => $this->body['row']->mod_id));
            $this->body['row']->module_title = $this->module->title . ' - нэмэх';

            $this->body['controlCategoryListDropdown'] = $this->category->controlCategoryListDropdown_model(array('modId' => $this->body['row']->mod_id, 'selectedId' => $this->body['row']->cat_id));

            echo json_encode(array(
                'title' => $this->body['row']->module_title,
                'btn_yes' => 'Хайх',
                'btn_no' => 'Хаах',
                'html' => $this->load->view(MY_ADMIN . '/nifsSendPhoto/formSearch', $this->body, TRUE)
            ));
        } else {
            redirect(MY_ADMIN);
        }
    }

    public function mLists() {
        //snifsSendPhoto/mLists/?userId=50&page=20
        $user = $this->user->getData_model(array('selectedId' => $this->input->get('userId')));

        $page = ($this->input->get('page') ? $this->input->get('page') : 0);
        $totalRows = $this->nifsSendPhoto->mListsCount_model(array(
            'userId' => $this->input->get('userId'),
            'departmentId' => $user->department_id));

        //pagination configuration
        $config['base_url'] = base_url('mLists');
        $config['total_rows'] = $totalRows;
        $config["cur_page"] = $page;
        $config['per_page'] = PAGINATION_PER_PAGE;
        $config['num_links'] = PAGINATION_NUM_LINKS;
        $config['link_func'] = '_initNifsSendPhoto';
        $this->pagination->initialize($config);

        echo json_encode(array(
            'totalRows' => $totalRows,
            'result' => $this->nifsSendPhoto->mLists_model(array(
                'userId' => $this->input->get('userId'),
                'departmentId' => $user->department_id,
                'limit' => PAGINATION_PER_PAGE,
                'page' => $page))));
    }

    public function mInsert() {
        echo json_encode($this->nifsSendPhoto->mInsert_model(array('getUID' => getUID('nifs_send_photo'))));
    }

    public function mForm() {

        $this->load->view(MY_ADMIN . '/nifsSendPhoto/mForm');
    }

    public function base64ToImage() {


        $data = '';

        $data = base64_decode($data); // base64 decoded image data
        $source_img = imagecreatefromstring($data);
        $file = '.' . UPLOADS_NIFS_SEND_PHOTO_PATH . 'ojjjj.jpg';
        $imageSave = imagejpeg($source_img, $file, 100);
        imagedestroy($source_img);
    }

    public function testPhoto() {
        $data = 'data:image/jpeg;base64,';

        $data = str_replace('data:image/jpeg;base64,', '', $data);

        $data = str_replace(' ', '+', $data);

        $data = base64_decode($data);



        $file = rand() . '.jpg';

        $success = file_put_contents($file, $data);
    }

}
